text:
Dois fatos são reais no São Paulo:

Não temos goleiro;
O goleiro do time rival vira o Nouer jogando contra nós.

 @gabrielruiz443  
O fato de continuar torcendo não quer dizer que está apoiando a diretoria. Oras! Vc quer que a torcida deixe de ir ao estádio e vire as costas para os jogos? 
A derrota foi doída, mas a temporada continua e o time tem que se afastar cada vez mais do Z4 e quem sabe buscar uma vaga na libertadores.
